import * as React from "react";
import Axios from "axios";
import { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Register() {
  const [Fist_name, setFist_name] = useState("");
  const [Last_name, setLast_name] = useState("");
  const [Phone, setPhone] = useState("");
  const [password, setpassword] = useState("");
  const [che,setche]=useState("")
  const navigate = useNavigate();

  const addcustomer = () => {
    Axios.post("http://localhost:2000/register", {
        // Fist_name : Fist_name,
        // Last_name : Last_name,
        // Phone : Phone,
        // password : password
        Fist_name : "Noppadon",
        Last_name : "Kaitsiri",
        Phone : "89889",
        password : "1234"
    }).then((response) => {
        setche(response.data.Fist_name+" "+response.data.Last_name)

      });
  };

  return (
    <body>
        <h1>Hello {che}</h1>
        <div className="box" >
         <div class="form">
         <form ></form>
            <div class='topic'>SIGN UP</div>
            <div className='text'>First Name : </div>
                      <input
                          type='text'
                          placeholder='Enter First Name'
                          onChange={(event) =>{
                                setFist_name(event.target.value)
                          }}  
                      />
            <div className='text'>Last Name : </div>
                      <input
                          type='text'

                          placeholder='Enter Last Name'
                          onChange={(event) =>{
                            setLast_name(event.target.value)
                          }}  
                      />
            <div className='text'>Phone Number : </div>
                      <input
                          type='text'

                          placeholder='Enter Phone Number'
                          onChange={(event) =>{
                            setPhone(event.target.value)
                          }}  
                      />

            <div className='password'  >Password : </div>
                      <input
                          type='password'

                          placeholder='Enter password'
                          onChange={(event) =>{
                            setpassword(event.target.value)
                          }}  
                      />

            <button onClick={addcustomer}> Sign up</button>

            <p class="message">Already register? <a href="login">Login</a></p>
        </div>
        </div>
        </body>
  );
}
